import { useEffect, useState } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import './App.css';
import BoardAgent from './components/BoardAgent';
import BoardClient from './components/BoardClient';
import Home from './components/Home';
import Login from './components/Login';
import Profile from './components/Dashboard';
import AuthService from './services/auth.service';
import Dashboard from './components/Dashboard';
import { Dropdown } from 'react-bootstrap';
import { Button } from 'bootstrap';

function App() {

  const [currentUser, setCurrentUser] = useState(undefined);

  useEffect(() => {
    const user = AuthService.getCurrentUser();
    if(user){
      setCurrentUser(user);
    }
  }, [])

  const logout = () => {
    AuthService.logout();
  }
  return (
    <div>
       <nav className="navbar navbar-expand-md navbar-dark bg-dark">
        <Link to={"/"} className="navbar-brand">
          InsuranceMS
        </Link>


        {currentUser ? (
          <div className="navbar-nav ml-auto">
            <li className="nav-item">
              <Dropdown>
              <Dropdown.Toggle variant="info">Profile</Dropdown.Toggle>
              <Dropdown.Menu>
                  {currentUser.username} 
                  {currentUser.role}                          
                </Dropdown.Menu>
              </Dropdown>
            </li>
            <li className="nav-item ml-3">
              <a href="/login" className="btn btn-warning" onClick={logout}>
                Logout
              </a>
            </li>
          </div>
        ) : (
          <div className="navbar-nav ml-auto">
            <li className="nav-item">
              <Link to={"/login"} className="btn btn-warning">
                Login
              </Link>
            </li>
          </div>
        )}
      </nav>
      <div className="container mt-3">
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/login" element={<Login/>} />
          <Route path="/dashboard" element={<Dashboard/>} />
          <Route path="/client" element={<BoardClient/>} />
          <Route path="/agent" element={<BoardAgent/>} />
        </Routes>
      </div>
      <footer className="AppFooter">
        <div>InsuranceMs Â©2023 Created by Carina Nechita</div>
      </footer>
    </div>
  );
}

export default App;
